//création des caractères numériques '0' à '9' au format 64 lignes, 32 col, au format 1bpp --> 64*4 = 256 octets.
//les caractères sont fournis par les tableau de 256 octets Tab_CharX. Chaque octet de ce tableau code 8 pixels,
//le bit de poids faible est le pixel le plus à droite. Pour le DCU, les mots de 32 bits contiennent 32 pixels.
//Les octets de ce mot sont rangés de sorte à ce que le bit de poit faible soit le picel le plus à gauche ! 
//Il y a donc une inversion de convention, que l'on compense ici.
//Les bits des caractères X sont rangés en SRAM, à partir de l'adresse Adr_Char_X (pointeur CharX)
void Create_Char(void) {
	uint8_t ind_char, i, j, k, m, ind;
	uint8_t masque, resu, resu2;
	uint32_t myWord;
	uint32_t *myChar;
	uint8_t *myTabChar;
	
	for (ind_char=0;ind_char<10;ind_char++) {
		if (ind_char == 0) {
			myChar = Char0;
			myTabChar = &Tab_Char0[0];
		}
		else if (ind_char == 1) {
			myChar = Char1;
			myTabChar = &Tab_Char1[0];
		}
		else if (ind_char == 2) {
			myChar = Char2;
			myTabChar = &Tab_Char2[0];
		}
		else if (ind_char == 3) {
			myChar = Char3;
			myTabChar = &Tab_Char3[0];
		}
		else if (ind_char == 4) {
			myChar = Char4;
			myTabChar = &Tab_Char4[0];
		}
		else if (ind_char == 5) {
			myChar = Char5;
			myTabChar = &Tab_Char5[0];
		}
		else if (ind_char == 6) {
			myChar = Char6;
			myTabChar = &Tab_Char6[0];
		}
		else if (ind_char == 7) {
			myChar = Char7;
			myTabChar = &Tab_Char7[0];
		}
		else if (ind_char == 8) {
			myChar = Char8;
			myTabChar = &Tab_Char8[0];
		}
		else if (ind_char == 9) {
			myChar = Char9;
			myTabChar = &Tab_Char9[0];
		}		

		for (i=0;i<H_Char;i++) {
				for (j=0;j<W_Char/PixelPerBit_Char;j++) {
					ind = i*W_Char/PixelPerBit_Char+j;
					*(myChar + ind) = 0; //on remet à 0 l'emplacement mémoire de la SRAM
					//on va utiliser 4 octets successifs dans Tab_Char0 pour créer un mot de 32 bits
					for (k=0;k<4;k++) {
						//on inverse les 8 bits de chaque octet
						masque = 0x01;
						resu2 = 0x00;
						for (m=0;m<4;m++) {
							resu = *(myTabChar+(4*ind+k)) & masque;
							resu = resu << (7-2*m);
							resu2 = resu2|resu;
							masque = masque <<1;
						}
						for (m=0;m<4;m++) {
							resu = *(myTabChar+(4*ind+k)) & masque;
							resu = resu >> (1+2*m);
							resu2 = resu2|resu;
							masque = masque <<1;
						}
						//on la place au bon endroit dans le mot de 32 bits qui sera mis en mémoire SRAM
						myWord = resu2;
						myWord = myWord << (8*(3-k));
						*(myChar + ind) = myWord | *(myChar + ind);
					}
				}
			}
	}
	
			
}

//création de l'image INSA (au format 4bpp)
void Create_image_INSA(void) {
	uint32_t i, j, k, ind, myWord;
	uint8_t resu, resuLSB, resuMSB, masqueMSB, masqueLSB;
	
	masqueMSB = 0xF0;
	masqueLSB = 0x0F;
		
	for (i=0;i<H_Image_INSA;i++) {
		for (j=0;j<W_Image_INSA/PixelPerWord_Image_INSA;j++) { //format 4bpp
			ind = i*W_Image_INSA/PixelPerWord_Image_INSA+j;
			*(Image_INSA + ind) = 0; //on remet à 0 l'emplacement mémoire de la SRAM
			//on va utiliser 4 octets successifs dans Tab_Image_INSA pour créer un mot de 32 bits
			for (k=0;k<4;k++) {
				//il faut intervertir dans chaque octet les 4 MSB avec les 4 LSB
				resuLSB = Tab_Image_INSA[4*ind+k] & masqueLSB; 
				resuMSB = Tab_Image_INSA[4*ind+k] & masqueMSB; 
				
				resuLSB = resuLSB << 4;
				resuMSB = resuMSB >> 4;
				
				resu = resuMSB|resuLSB;
				myWord = resu;
				myWord = myWord << (8*(3-k));
				*(Image_INSA + ind) = myWord | *(Image_INSA + ind);
			}	
		}
	}
}  

//Ecriture d'une image quelconque (image ou caractère alphanumérique) stocké en mémoire en un emplacement donné de la mémoire Layer
//paramètres d'entrée :
//adress_write : l'adresse de l'emplacement mémoire Layer où on doit écrire l'image
//Poiter_Picture : Pointeur sur l'adresse où est stocké l'image à écrire
//W_Picture, H_Picture : largeur et hauteur en pixels de l'image
//PixelPerWord : nombre de pixels encodés par un mot de 32 bits (dépendant du format de l'image) 
void write_Image(uint32_t adress_write, uint32_t * Pointer_Picture, uint32_t W_Picture, uint32_t H_Picture, uint8_t PixelPerWord) {
	uint32_t i, j, ind;
	uint32_t * MonPointeurMem = (uint32_t *) adress_write;
	
	for (i=0;i<H_Picture;i++) {
		for (j=0;j<W_Picture/PixelPerWord;j++) {
			ind = i*W_Picture/PixelPerWord+j;
			*(MonPointeurMem+ind) = *(Pointer_Picture+ind);
		}
	}
} 


//On écrit l'heure au format MM:SS sur un layer donné. On doit écrire 4 caractères numériques. Les 2 caractères pour les minutes
//peuvent être espacés ou non par le harware curseur des 2 caractères pour les secondes. Si on place le curseur, il faut en fait écrire
//5 caractères. Celui à la place du curseur est totalement vide.
//Il convient de vérifier l'accord entre l'espace mémoire dispo pour le layer et la place occupée par les 4 ou 5 caractères à afficher.
//paramètres d'entrée :
//adress_Layer: adresse du layer où il faut écrire l'heure. Les caractères seront placés en début de mémoire.
//PixelPerWord : nombre de pixels encodés par un mot de 32 bits (dépendant du format de l'image)
//W_Char, H_Char : largeur et hauteur en pixels des caractères
//CursorActivate : si 0, alors le curseur n'apparait pas. Sinon, il apparait et il faut écrire 5 caractères, dont un vide
//adr_CharMin1, adr_CharMin2, adr_CharSec1, adr_Char_Sec2 : adresses des 4 caracères à afficher : Min1Min2 : Sec1Sec2
void write_Time_Char(uint32_t * Pointer_Layer, uint32_t W_car, uint32_t H_car, uint8_t PixelPerWord, uint8_t CursorActivate, uint32_t * Pointer_CharMin1, uint32_t * Pointer_CharMin2, uint32_t * Pointer_CharSec1, uint32_t * Pointer_CharSec2) {
	uint8_t Nchar;
	uint32_t i, j, indlayer, indchar, W_layer, H_layer;
	
	if (CursorActivate == 0) {
		Nchar = 4;
	}
	else {
		Nchar = 5;
	}
	W_layer = Nchar*W_car;
	H_layer = H_car;
	
	for (i=0;i<H_layer;i++) {
		//écriture des 2 caractères de minute
		//Min1
		for (j=0;j<W_car/PixelPerWord;j++) {
			indlayer = i*W_layer/PixelPerWord+j;
			indchar = i*W_car/PixelPerWord+j;
			*(Pointer_Layer+indlayer) = *(Pointer_CharMin1+indchar);
		}
		//Min2
		for (j=0;j<W_car/PixelPerWord;j++) {
			indlayer = i*W_layer/PixelPerWord+1*W_car/PixelPerWord+j;
			indchar = i*W_car/PixelPerWord+j;
			*(Pointer_Layer+indlayer) = *(Pointer_CharMin2+indchar);
		}	
		//selon la présence ou non du hardware cursor, on écrit que les secondes, ou un caractère vide suivi des secondes
		if (CursorActivate == 0) {
			//écriture des secondes
			//Sec1
			for (j=0;j<W_car/PixelPerWord;j++) {
				indlayer = i*W_layer/PixelPerWord+2*W_car/PixelPerWord+j;
				indchar = i*W_car/PixelPerWord+j;
				*(Pointer_Layer+indlayer) = *(Pointer_CharSec1+indchar);
			}	
			//Sec2
			for (j=0;j<W_car/PixelPerWord;j++) {
				indlayer = i*W_layer/PixelPerWord+3*W_car/PixelPerWord+j;
				indchar = i*W_car/PixelPerWord+j;
				*(Pointer_Layer+indlayer) = *(Pointer_CharSec2+indchar);
			}			
		}
		else {
			//écriture d'un caractère vide
			for (j=0;j<W_car/PixelPerWord;j++) {
				indlayer = i*W_layer/PixelPerWord+2*W_car/PixelPerWord+j;
				*(Pointer_Layer+indlayer) = 0x00; //totalement transparent
			}			
			
			//écriture des secondes
			//Sec1
			for (j=0;j<W_car/PixelPerWord;j++) {
				indlayer = i*W_layer/PixelPerWord+3*W_car/PixelPerWord+j;
				indchar = i*W_car/PixelPerWord+j;
				*(Pointer_Layer+indlayer) = *(Pointer_CharSec1+indchar);
			}	
			//Sec2
			for (j=0;j<W_car/PixelPerWord;j++) {
				indlayer = i*W_layer/PixelPerWord+4*W_car/PixelPerWord+j;
				indchar = i*W_car/PixelPerWord+j;
				*(Pointer_Layer+indlayer) = *(Pointer_CharSec2+indchar);
			}				
		}	
	}
}  

//on écrit le contenu de la Color LUT (CLUT) : address from 0x2000 to 0x3FFF (adresse de base = 0xFFE5C000)
//  --> 8192 octets --> 2048 mots de 32 bits
//format AARRGGBB
void Write_CLUT() {
	//Couleurs pour le layer 1 (2 couleurs)
	//entrée 0 (0x2000) : fond blanc
	*(CLUT) = 0xFFFFFFFF;
	//entrée 1 (0x2001) : noir
	*(CLUT+1) = 0xFF000000;
	
	//Couleurs pour le layer 2 (4 couleurs)
	//entrée 2 (0x2002) : bleu
	*(CLUT+2) = 0xFF0000FF;
	//entrée 3 (0x2003) : blanc
	*(CLUT+3) = 0xFFFFFFFF;
	//entrée 4 (0x2003) : rouge
	*(CLUT+4) = 0xFFFF0000;
	//entrée 5 (0x2003) : vert
	*(CLUT+5) = 0xFF00FF00;
	
	//Couleurs pour le layer 3 (16 couleurs)
	//entrées 6 à 21
	*(CLUT+6) = 0xFF000000; //blanc
	*(CLUT+7) = 0xFF800000;
	*(CLUT+8) = 0xFF008000;
	*(CLUT+9) = 0xFF808000;
	*(CLUT+10) = 0xFF000080;
	*(CLUT+11) = 0xFF800080;
	*(CLUT+12) = 0xFF008080;
	*(CLUT+13) = 0xFF808080;
	*(CLUT+14) = 0xFFC0C0C0;
	*(CLUT+15) = 0xFFFF0000;
	*(CLUT+16) = 0xFF00FF00;
	*(CLUT+17) = 0xFFFFFF00;
	*(CLUT+18) = 0xFF0000FF;
	*(CLUT+19) = 0xFFFF00FF;
	*(CLUT+20) = 0xFF00FFFF;
	*(CLUT+21) = 0xFFFFFFFF;	
}

//on remplit la mémoire du curseur = 32 * 32 pixels au format 1 bpp
//il s'agit de 2 carrés noirs de 8 * 8 pixels, centrés sur la zone de 32*32 pixels, alignés verticalement et séparés par 8 pixels. 
//Un bit = 1 pixel !
//Le reste est transparent.
void LoadMemCursor() {
	uint32_t ind, i;

	ind = 0;
	//partie haute du curseur = transparent
	for (i=0;i<4;i++) {
			*(Cursor+ind) = 0x00000000; //curseur complètement transparent (bit = 0)
			ind = ind+1;
	}
	
	//carré supérieur (8*8 pixels)
	for (i=0;i<8;i++) {
		//la largeur du curseur étant de 8 pixels, on met à '1'  seulement les 8 bits de poids forts.
		*(Cursor+ind) = 0x000FF000; //curseur complètement opaque (bit = 1)
		ind = ind+1;
	}
	
	//espace entre les 2 carrés, de hauteur = 8 pixels
	//pixels transparents
	for (i=0;i<8;i++) {
		*(Cursor+ind) = 0x00000000; //curseur complètement transparent (bit = 0)
		ind = ind+1;
	} 
	
	//carré inférieur (8*8 pixels)
	for (i=0;i<8;i++) {
		//la largeur du curseur étant de 8 pixels, on met à '1'  seulement les 8 bits de poids forts.
		*(Cursor+ind) = 0x000FF000; //curseur complètement opaque (bit = 1)
		ind = ind+1;
	}
	 
	//partie basse du curseur = transparent
	for (i=0;i<4;i++) {
		*(Cursor+ind) = 0x00000000; //curseur complètement transparent (bit = 0)
		ind = ind+1;
	}
}

//initialisation du Layer 1 : on place 4 caractères '0' pour indiquer les secondes et les minutes
void LoadMemoryGraphic_Layer1() {
	write_Time_Char(Layer1, W_Char, H_Char, PixelPerBit_Char, 1, Char0, Char0, Char0, Char0);
}


//Initialisation du Layer 2 = drapeau français apparaissance au-dessus du cadre en haut à droite.
void LoadMemoryGraphic_Layer2(void) {
	uint32_t i, j, ind;
	
	//on trace le drapeau français en balayant les entrées de la look-up table (mode 2bpp)
	for (i=0;i<Layer2_H;i++) {
		for (j=0;j<(Layer2_W/PixelPerWord_2bpp);j++) {
			ind = i*Layer2_W/PixelPerWord_2bpp+j;
			if (j == 0) {  //les 16 pixels les plus à gauche
				*(Layer2+ind) = 0x00000000; //bleu --> entrée 0 de la CLUT % offset = 2
			}
			if (j == 1) {  //les 16 pixels au centre
				*(Layer2+ind) = 0x55555555; //blanc --> entrée 1 de la CLUT % offset = 2
			}			
			if (j == 2) {  //les 16 pixels les plus à droite
				*(Layer2+ind) = 0xAAAAAAAA; //rouge --> entrée 2 de la CLUT % offset = 2
			}
		}	
	}	
}

