//Initialisation du Layer 4 = cadre en haut à gauche. Liseré noir d'une largeur = 2 px sur le bord du cadre. Utilisation de la CLUT (entrée 0 et 1)
void LoadMemoryGraphic_Layer4()
{
	uint32_t i, j, ind;
	
	for (i=0;i<Layer4_H;i++) {
		for (j=0;j<(Layer4_W/PixelPerWord_Cadre);j++) {
			ind = i*Layer4_W/PixelPerWord_Cadre+j;
			
			if ((i < 2)|(i > Layer4_H-3)) {  //en haut et en bas du cadre --> trait noir (entrée 1 de la CLUT)
				*(Layer4+ind) = 0xFFFFFFFF;
			}
			else if ((j == 0))  { //bord gauche
				*(Layer4+ind) = 0x03000000;
			}
			else if ((j == Layer4_W/32-1))  { //bord droit
				*(Layer4+ind) = 0x000000C0;
			}
			else {                 //le reste : fond blanc --> entrée 2 de la CLUT
				*(Layer4+ind) = 0x00000000;	
			}
			
		}
	}
	
}

