//Initialisation de tous les layers graphiques (6 layers utilisateurs + hardware cursor) et de la CLUT
void InitLayerMemory(void) {
	Create_Char();
	Create_image_INSA();
	Write_CLUT();
	LoadMemoryGraphic_Layer1();
	LoadMemoryGraphic_Layer2();
	LoadMemoryGraphic_Layer3();
	LoadMemoryGraphic_Layer4();
	LoadMemoryGraphic_Layer5();
	LoadMemoryGraphic_Layer6();
	LoadMemCursor();
}


uint32_t * Correspondance_Chiffre_Char(uint8_t Chiffre) {
	uint32_t * MyPointeur;
	
	if (Chiffre == 0) {
		MyPointeur = Char0;
	}
	else if (Chiffre == 1) {
		MyPointeur = Char1;
	}
	else if (Chiffre == 2) {
		MyPointeur = Char2;
	}
	else if (Chiffre == 3) {
		MyPointeur = Char3;
	}
	else if (Chiffre == 4) {
		MyPointeur = Char4;
	}
	else if (Chiffre == 5) {
		MyPointeur = Char5;
	}
	else if (Chiffre == 6) {
		MyPointeur = Char6;
	}
	else if (Chiffre == 7) {
		MyPointeur = Char7;
	}
	else if (Chiffre == 8) {
		MyPointeur = Char8;
	}
	else if (Chiffre == 9) {
		MyPointeur = Char9;
	}

	return(MyPointeur);
}

//on modifie l'heure affichée par l'écran LCD (fomat M1M2 : S1S2)
void Change_Time_LCD(uint8_t M1, uint8_t M2, uint8_t S1, uint8_t S2) {
	uint32_t * Pointeur_Sec1;
	uint32_t * Pointeur_Sec2;
	uint32_t * Pointeur_Min1;
	uint32_t * Pointeur_Min2;

	Pointeur_Sec1 = Correspondance_Chiffre_Char(S1);
	Pointeur_Sec2 = Correspondance_Chiffre_Char(S2);
	Pointeur_Min1 = Correspondance_Chiffre_Char(M1);
	Pointeur_Min2 = Correspondance_Chiffre_Char(M2);
	write_Time_Char(Layer1, W_Char, H_Char, PixelPerBit_Char, 1, Pointeur_Min1, Pointeur_Min2, Pointeur_Sec1, Pointeur_Sec2);
}



